import React from 'react';
import SquareButton from './SquareButton';
import * as enumerations from '../constants/enumerations';

export default function ProductStandouts() {
  return (
    <React.Fragment>
      <div className="product-standouts-wrapper">
        <h3>Product Standouts</h3>
        <h4>Choose up to 5 that best apply (optional)</h4>
        <div className="product-standouts-container">
          <SquareButton
            value={enumerations.productStandouts.accurateTimekeeping}
          />
          <SquareButton value={enumerations.productStandouts.highQuality} />
          <SquareButton value={enumerations.productStandouts.durable} />
          <SquareButton value={enumerations.productStandouts.elegant} />
          <SquareButton value={enumerations.productStandouts.goodWeight} />
          <SquareButton value={enumerations.productStandouts.versatile} />
          <SquareButton value={enumerations.productStandouts.looksExpensive} />
          <SquareButton
            value={enumerations.productStandouts.attractsCompliments}
          />
          <SquareButton value={enumerations.productStandouts.unique} />
          <SquareButton value={enumerations.productStandouts.greatGift} />
          <SquareButton value={enumerations.productStandouts.greatValue} />
        </div>
      </div>
    </React.Fragment>
  );
}
